import Axios from "axios";

export function Home() {
    const [data, setData] = useState([]);

    useEffect(() => {
        getData();
    }, []);

    async function getData() {
        Axios({
            method: "GET",
            url: "http://localhost:8000/movies/get",
            headers: {
                "Content-Type": "application/json"
            }
        }).then(res => {
            setData(res.data)
        });
    }
    console.log(data)
